mapper.select:

select 

from NPSUNIT
where NPSUNIT_NO = #{npsunitNo,jdbcType=CHAR}
  and NPSUNIT_PAYTYPE = #{npsunitPaytype,jdbcType=CHAR}
  and NPSUNIT_FEENO = #{npsunitFeeno,jdbcType=CHAR}

mapper.delete:

delete from NPSUNIT
where NPSUNIT_NO = #{npsunitNo,jdbcType=CHAR}
  and NPSUNIT_PAYTYPE = #{npsunitPaytype,jdbcType=CHAR}
  and NPSUNIT_FEENO = #{npsunitFeeno,jdbcType=CHAR}
